import React from 'react'

const Userview = () => {
  return (
    <div className="uservw">
        <h2>Profile</h2>
        <div className="alluserdt">
            
            <img src="https://i1.sndcdn.com/avatars-LH92hC7SFmybsuap-ChJvVg-t500x500.jpg"></img>
            <h3>Personal Info</h3>
            {userdata.map((item, index) => {
                return <div className="dashfrmstat">
                        <div key={index} >
                            
                            <h3>Email: </h3>
                            <p >{item.username} </p><br/>
                            <h3>ID: </h3>
                            <p >{item.iid} </p> <br/>
                            <h3>Department: </h3>
                            <p >{item.dept} </p> <br/>
                            <h3>Available Rooms: </h3>
                            {item.dept== "CSE"? <p>301 302 205 105 106</p>: <p>303 304 103 104</p>}
                            {/*<p >{loggedstat} </p> <br/>*/}
                            
                        </div>
                </div>
            })}
        </div>
    </div>
  )
}

export default Userview
